column3:
@BenFordham @JoshFrydenberg Outrageous how lax the whole process seems, and how little transparency and responsibility anyone is taking for handing out $444m of taxpayer money.
Great interview Ben, and we need journalists to do this each time a politician tries to avoid answering questions.
#auspol

